import{_ as e,o as t,c as o,a as i}from"./app.4bbcad62.js";const r="/ybhdsg-zhs/assets/image-20210222132936016.16b1b41b.png",l="/ybhdsg-zhs/assets/image-20210222133524146.4df552a5.png",f=JSON.parse('{"title":"GIT \u76F8\u5173","description":"","frontmatter":{},"headers":[{"level":2,"title":"1. \u4F60\u4EEC\u7684 Git \u5DE5\u4F5C\u6D41\u662F\u4EC0\u4E48\u6837\u7684\uFF1F","slug":"_1-\u4F60\u4EEC\u7684-git-\u5DE5\u4F5C\u6D41\u662F\u4EC0\u4E48\u6837\u7684","link":"#_1-\u4F60\u4EEC\u7684-git-\u5DE5\u4F5C\u6D41\u662F\u4EC0\u4E48\u6837\u7684","children":[]},{"level":2,"title":"2. Git \u7684 rebase \u548C merge \u7684\u533A\u522B\u662F\u4EC0\u4E48\uFF1F","slug":"_2-git-\u7684-rebase-\u548C-merge-\u7684\u533A\u522B\u662F\u4EC0\u4E48","link":"#_2-git-\u7684-rebase-\u548C-merge-\u7684\u533A\u522B\u662F\u4EC0\u4E48","children":[]}],"relativePath":"pages/interviews/git.md"}'),a={name:"pages/interviews/git.md"},d=i('<h1 id="git-\u76F8\u5173" tabindex="-1">GIT \u76F8\u5173 <a class="header-anchor" href="#git-\u76F8\u5173" aria-hidden="true">#</a></h1><h2 id="_1-\u4F60\u4EEC\u7684-git-\u5DE5\u4F5C\u6D41\u662F\u4EC0\u4E48\u6837\u7684" tabindex="-1">1. \u4F60\u4EEC\u7684 Git \u5DE5\u4F5C\u6D41\u662F\u4EC0\u4E48\u6837\u7684\uFF1F <a class="header-anchor" href="#_1-\u4F60\u4EEC\u7684-git-\u5DE5\u4F5C\u6D41\u662F\u4EC0\u4E48\u6837\u7684" aria-hidden="true">#</a></h2><p>\u6BCF\u4E2A\u516C\u53F8\u91C7\u7528\u7684 Git \u5DE5\u4F5C\u6D41\u90FD\u53EF\u80FD\u4F1A\u6709\u5DEE\u522B\uFF0C\u6709\u7684\u6BD4\u8F83\u89C4\u8303\uFF0C\u6709\u7684\u6BD4\u8F83\u968F\u610F\u3002\u5728\u8FD9\u91CC\u4ECB\u7ECD\u4E00\u4E2A\u540D\u4E3A GitFlow \u7684 git \u6807\u51C6\u64CD\u4F5C\u6D41\u7A0B\u3002</p><p>\u5728 GitFlow \u6807\u51C6\u4E0B\uFF0C\u6211\u4EEC\u7684 git \u4ED3\u5E93\u9700\u8981\u5305\u542B\u4EE5\u4E0B\u51E0\u4E2A\u5173\u952E\u5206\u652F\uFF1A</p><ul><li>master\uFF1A\u4E3B\u5206\u652F</li><li>develop\uFF1A\u4E3B\u5F00\u53D1\u5206\u2F40\u3002\u5305\u542B\u786E\u5B9A\u5373\u5C06\u53D1\u5E03\u7684\u4EE3\u7801</li><li>feature\uFF1A\u65B0\u529F\u80FD\u5206\u2F40\u3002\u2F00\u4E2A\u65B0\u529F\u80FD\u5BF9\u5E94\u2F00\u4E2A\u5206\u2F40</li><li>release\uFF1A\u53D1\u5E03\u5206\u2F40\u3002\u53D1\u5E03\u65F6\u2F64\u7684\u5206\u2F40\uFF0C\u2F00\u822C\u6D4B\u8BD5\u9636\u6BB5\u53D1\u73B0\u7684 bug \u5728\u8FD9\u4E2A\u5206\u2F40\u8FDB\u2F8F\u4FEE\u590D</li><li>hotfix\uFF1A\u70ED\u8865\u4E01\u5206\u652F\u3002\u7528\u4E8E\u4FEE\u6539\u5728\u7EBF\u4E0A\u7248\u672C\u4E2D\u53D1\u73B0\u7684\u4E25\u91CD\u7D27\u6025 bug</li></ul><p><strong>GitFlow \u7684\u4E3B\u8981\u4F18\u70B9</strong></p><ol><li>\u652F\u6301\u5E76\u2F8F\u5F00\u53D1</li></ol><p>\u56E0\u4E3A\u6BCF\u4E2A\u65B0\u529F\u80FD\u90FD\u4F1A\u5EFA\u2F74\u2F00\u4E2A\u65B0\u7684 feature \u5206\u2F40\uFF0C\u4ECE\u2F7D\u548C\u5176\u4ED6\u5DF2\u7ECF\u5B8C\u6210\u7684\u529F\u80FD\u9694\u79BB\u5F00\uFF0C\u4E14\u5F53\u53EA\u6709\u5728\u65B0\u529F\u80FD\u5B8C\u6210\u5F00\u53D1\u7684\u60C5\u51B5\u4E0B\uFF0C\u5176\u5BF9\u5E94\u7684 feature \u5206\u2F40\u624D\u4F1A\u88AB\u5408\u5E76\u5230\u4E3B\u5F00\u53D1\u5206\u2F40\uFF08develop \u5206\u652F\uFF09\u3002</p><p>\u53E6\u5916\uFF0C\u5982\u679C\u4F60\u6B63\u5728\u5F00\u53D1\u67D0\u4E2A\u529F\u80FD\u7684\u540C\u65F6\u2F1C\u6709\u2F00\u4E2A\u65B0\u529F\u80FD\u9700\u8981\u5F00\u59CB\u5F00\u53D1\uFF0C\u90A3\u4E48\u4F60\u53EA\u9700\u628A\u5F53\u524D feature \u7684\u4EE3\u7801\u63D0\u4EA4\u540E\uFF0C\u65B0\u5EFA\u53E6\u5916\u2F00\u4E2A feature \u5206\u2F40\u5373\u53EF\u5F00\u53D1\u65B0\u529F\u80FD\u4E86\u3002</p><p>\u4F60\u4E5F\u53EF\u4EE5\u968F\u65F6\u5207\u56DE\u4E4B\u524D\u7684\u5176\u4ED6 feature \u5206\u2F40\u7EE7\u7EED\u5B8C\u6210\u8BE5\u529F\u80FD\u7684\u5F00\u53D1\u3002</p><ul><li>\u534F\u4F5C\u5F00\u53D1</li></ul><p>\u56E0\u4E3A\u6BCF\u4E2A feature \u5206\u2F40\u4E0A\u6539\u52A8\u7684\u4EE3\u7801\u90FD\u53EA\u5BF9\u8BE5 feature \u5BF9\u5E94\u7684\u529F\u80FD\u751F\u6548\uFF0C\u6240\u4EE5\u4E0D\u540C feature \u5206\u652F\u4E0A\u7684\u4EE3\u7801\u5728\u5F00\u53D1\u65F6\u4E0D\u4F1A\u4E92\u76F8\u5F71\u54CD\uFF0C\u5927\u5BB6\u53EF\u4EE5\u76F8\u5B89\u65E0\u4E8B\u7684\u5F00\u53D1\u81EA\u5DF1\u8D1F\u8D23\u7684\u529F\u80FD\u3002</p><p>\u540C\u65F6\u6211\u4EEC\u53EF\u4EE5\u6839\u636E\u5206\u652F\u7684\u540D\u79F0\uFF0C\u5F88\u5BB9\u6613\u77E5\u9053\u6BCF\u4E2A\u2F08\u90FD\u5728\u505A\u4EC0\u4E48\u529F\u80FD\u3002</p><ul><li>\u53D1\u5E03\u9636\u6BB5</li></ul><p>\u5F53\u2F00\u4E2A\u65B0 feature \u5F00\u53D1\u5B8C\u6210\u65F6\uFF0C\u5B83\u4F1A\u88AB\u5408\u5E76\u5230 develop \u5206\u2F40\uFF0C\u8FD9\u5C31\u610F\u5473\u7740 develop \u5206\u652F\u4E0A\u5305\u542B\u4E86\u6240\u6709\u5DF2\u7ECF\u5F00\u53D1\u5B8C\u6210\u7684\u529F\u80FD\u3002</p><p>\u56E0\u6B64\uFF0C\u5728\u5F00\u53D1\u65B0\u7684 feature \u65F6\uFF0C\u6211\u4EEC\u53EA\u9700\u4ECE develop \u5206\u2F40\u6765\u521B\u5EFA\u65B0\u7684\u5206\u2F40\uFF0C\u5373\u53EF\u5728\u65B0\u7684 feature \u5206\u652F\u4E2D\u5305\u542B\u6240\u6709\u5DF2\u5B8C\u6210\u7684\u6700\u65B0\u529F\u80FD\u3002</p><ul><li>\u2F40\u6301\u7D27\u6025\u4FEE\u590D</li></ul><p>hotfix \u5206\u2F40\u662F\u4ECE\u67D0\u4E2A\u5DF2\u7ECF\u53D1\u5E03\u7684 Tag \u4E0A\u521B\u5EFA\u51FA\u6765\u6765\uFF0C\u7528\u4E8E\u7D27\u6025\u4FEE\u590D Bug\u3002</p><p>\u8BE5\u7D27\u6025\u4FEE\u590D\u53EA\u5F71\u54CD\u8FD9\u4E2A\u5DF2\u7ECF\u53D1\u5E03\u7684 Tag\uFF0C\u2F7D\u4E0D\u4F1A\u5F71\u54CD\u4F60\u6B63\u5728\u5F00\u53D1\u7684\u5176\u4ED6\u65B0 feature \u3002</p><p><strong>\u6CE8\u610F\u70B9</strong></p><ol><li><p>feature \u5206\u2F40\u90FD\u662F\u4ECE develop \u5206\u2F40\u4E0A\u521B\u5EFA\u7684\uFF0C\u5F00\u53D1\u5B8C\u6210\u540E\u518D\u5408\u5E76\u5230 develop \u5206\u2F40\u4E0A\uFF0C\u7B49\u5F85\u53D1\u5E03</p></li><li><p>\u5F53\u9700\u8981\u53D1\u5E03\u65F6\uFF0C\u6211\u4EEC\u8981\u4ECE develop \u5206\u2F40\u4E0A\u521B\u5EFA\u2F00\u4E2A release \u5206\u2F40\uFF0C\u7136\u540E\u8BE5 release \u5206\u2F40\u4F1A\u53D1\u5E03\u5230\u6D4B\u8BD5\u73AF\u5883\u8FDB\u2F8F\u6D4B\u8BD5\u3002\u5982\u679C\u53D1\u73B0\u95EE\u9898\u7684\u8BDD\uFF0C\u5C31\u4F1A\u76F4\u63A5\u5728\u8BE5\u5206\u2F40\u4E0A\u8FDB\u2F8F\u4FEE\u590D\u3002\u6240\u6709\u95EE\u9898\u4FEE\u590D\u4E4B\u524D\uFF0C\u4F1A\u4E0D\u505C\u91CD\u590D <code>\u53D1\u5E03</code> &gt; <code>\u6D4B\u8BD5</code> &gt; <code>\u4FEE\u590D</code> &gt; <code>\u91CD\u65B0\u53D1\u5E03</code> &gt; <code>\u91CD\u65B0\u6D4B\u8BD5</code> \u6D41\u7A0B\u3002 \u53D1\u5E03\u7ED3\u675F\uFF0C\u8BE5 release \u5206\u2F40\u4F1A\u88AB\u5408\u5E76\u5230 develop \u4EE5\u53CA master \u5206\u2F40\uFF0C\u4ECE\u2F7D\u4FDD\u8BC1\u4E0D\u4F1A\u6709\u4EE3\u7801\u4E22\u5931</p></li><li><p>master \u5206\u2F40\u53EA\u8DDF\u8E2A\u5DF2\u7ECF\u53D1\u5E03\u7684\u4EE3\u7801\uFF0C\u5408\u5E76\u5230 master \u4E0A\u7684 commit \u53EA\u80FD\u6765\u2F83 release \u5206\u2F40\u548C hotfix \u5206\u2F40</p></li><li><p>hotfix \u5206\u2F40\u7684\u4F5C\u2F64\u662F\u7D27\u6025\u4FEE\u590D\u2F00\u4E9B Bug\uFF0C\u5B83\u4EEC\u90FD\u662F\u4ECE master \u5206\u2F40\u4E0A\u7684\u67D0\u4E2A Tag \u5EFA\u2F74\uFF0C\u4FEE\u590D\u7ED3\u675F\u540E\u518D\u4F1A\u88AB\u5408\u5E76\u5230 develop \u548C master \u5206\u2F40\u4E0A</p></li></ol><p><a href="https://www.ruanyifeng.com/blog/2015/12/git-workflow.html" target="_blank" rel="noreferrer">\u53C2\u8003\u6587\u7AE0\uFF1AGit \u5DE5\u4F5C\u6D41</a></p><h2 id="_2-git-\u7684-rebase-\u548C-merge-\u7684\u533A\u522B\u662F\u4EC0\u4E48" tabindex="-1">2. Git \u7684 rebase \u548C merge \u7684\u533A\u522B\u662F\u4EC0\u4E48\uFF1F <a class="header-anchor" href="#_2-git-\u7684-rebase-\u548C-merge-\u7684\u533A\u522B\u662F\u4EC0\u4E48" aria-hidden="true">#</a></h2><p><code>git rebase</code> \u548C <code>git merge</code> \u4E24\u4E2A\u547D\u4EE4\u90FD\u2F64\u4E8E\u4ECE\u2F00\u4E2A\u5206\u2F40\u83B7\u53D6\u5185\u5BB9\u5E76\u5408\u5E76\u5230\u5F53\u524D\u5206\u2F40\u3002</p><p>\u4EE5\u4E00\u4E2A <code>feature/todo</code> \u5206\u2F40\u5408\u5E76\u5230 <code>master</code>\u4E3B\u5206\u2F40\u4E3A\u4F8B\uFF0C\u6211\u4EEC\u6765\u770B\u4E00\u4E0B\u5206\u522B\u2F64 <code>rebase</code> \u548C <code>merge</code> \u4F1A\u6709\u4EC0\u4E48\u4E0D\u540C\u3002</p><p><strong>\u4F7F\u7528 Merge</strong></p><img src="'+r+'" alt="image-20210222132936016" style="zoom:30%;"><p><code>merge</code> \u4F1A\u2F83\u52A8\u521B\u5EFA\u2F00\u4E2A\u65B0\u7684 <code>commit</code>\uFF0C \u5982\u679C\u5408\u5E76\u65F6\u9047\u5230\u51B2\u7A81\u7684\u8BDD\uFF0C\u53EA\u9700\u8981\u4FEE\u6539\u540E\u91CD\u65B0 <code>commit</code>\u3002</p><ul><li><p>\u4F18\u70B9\uFF1A\u80FD\u8BB0\u5F55\u771F\u5B9E\u7684 <code>commit</code> \u60C5\u51B5\uFF0C\u5305\u62EC\u6BCF\u4E2A\u5206\u2F40\u7684\u8BE6\u60C5</p></li><li><p>\u7F3A\u70B9\uFF1A\u7531\u4E8E\u6BCF\u6B21 <code>merge</code> \u4F1A\u2F83\u52A8\u4EA7\u2F63\u2F00\u4E2A <code>merge commit</code>\uFF0C\u56E0\u6B64\u5728\u4F7F\u2F64\u2F00\u4E9B\u53EF\u89C6\u5316\u7684 git \u5DE5\u5177\u65F6\u4F1A\u770B\u5230\u8FD9\u4E9B\u81EA\u52A8\u4EA7\u751F\u7684 <code>commit</code>\uFF0C\u8FD9\u4E9B <code>commit</code> \u5BF9\u4E8E\u7A0B\u5E8F\u5458\u6765\u8BF4\u6CA1\u6709\u4EC0\u4E48\u7279\u522B\u7684\u610F\u4E49\uFF0C\u53CD\u800C\u4F1A\u5F71\u54CD\u9605\u8BFB</p></li></ul><p><strong>\u4F7F\u7528 Rebase</strong></p><img src="'+l+'" alt="image-20210222133524146" style="zoom:30%;"><p><code>rebase</code> \u4F1A\u5408\u5E76\u4E4B\u524D\u7684 <code>commit</code> \u5386\u53F2\u3002</p><ul><li><p>\u4F18\u70B9\uFF1A\u53EF\u4EE5\u5F97\u5230\u66F4\u7B80\u6D01\u7684\u63D0\u4EA4\u5386\u53F2\uFF0C\u53BB\u6389\u4E86 <code>merge commit</code></p></li><li><p>\u7F3A\u70B9\uFF1A\u56E0\u4E3A\u5408\u5E76\u800C\u4EA7\u751F\u7684\u4EE3\u7801\u95EE\u9898\uFF0C\u5C31\u4E0D\u5BB9\u6613\u5B9A\u4F4D\uFF0C\u56E0\u4E3A\u4F1A\u91CD\u5199\u63D0\u4EA4\u5386\u53F2\u4FE1\u606F</p></li></ul><p><strong>\u5EFA\u8BAE</strong></p><ul><li><p>\u5F53\u9700\u8981\u4FDD\u7559\u8BE6\u7EC6\u7684\u5408\u5E76\u4FE1\u606F\u65F6\uFF0C\u5EFA\u8BAE\u4F7F\u2F64 <code>git merge</code>\uFF0C\u7279\u522B\u662F\u9700\u8981\u5C06\u5206\u2F40\u5408\u5E76\u8FDB <code>master</code> \u5206\u2F40\u65F6</p></li><li><p>\u5F53\u53D1\u73B0\u2F83\u2F30\u4FEE\u6539\u67D0\u4E2A\u529F\u80FD\u65F6\u63D0\u4EA4\u6BD4\u8F83\u9891\u7E41\uFF0C\u5E76\u89C9\u5F97\u8FC7\u591A\u7684\u63D0\u4EA4\u4FE1\u606F\u5BF9\u81EA\u5DF1\u6765\u8BF4\u6CA1\u6709\u5FC5\u8981\uFF0C\u90A3\u4E48\u53EF\u5C1D\u8BD5\u4F7F\u7528 <code>git rebase</code></p></li></ul>',35),c=[d];function p(s,g,m,n,u,_){return t(),o("div",null,c)}const b=e(a,[["render",p]]);export{f as __pageData,b as default};
